import React from 'react'
import { Button } from 'react-bootstrap';
import './ProductDetail.css';

interface Props {
    setAuth: (isAuthenticated: boolean) => void;
}

const ProductDetailScreen = ({ setAuth }: Props) => {
    return (
        <div className='container'>
            <img src='https://talksport.com/wp-content/uploads/sites/5/2022/10/crop-1208117.jpg?strip=all&quality=100&w=1920&h=1080&crop=1' />
            <div>
                <h3>Image Title</h3>
                <p>I am a passionate software builder and technology enthusiast. I identify myself as a learner of this never ending evolution, which concentrates on software development efficiency. I have worked as Software Engineer at BlueOptima. I learned about understandable code writing , efficiency and innovation in programming. I took part in sprint planning, progress review and sprint review meetings. I worked on feature creation and analysis, bug resolve, unit and integration tests, query optimization, support tickets and improved CI/CD pipeline Jenkins script. I have also worked in freelancing project previously, in which I used Python Django and PostgreSQL database.  I also have worked as a research intern and participated in research collaboration for the innovation in problem solving. I regularly practice coding problems on LeetCode and Codeforces. I have the skills such as Python,Java, C/C++, JavaScript, HTML/CSS, LATEX, SpringBoot,DBMS,CNN,Machine Learning,Deep Learning,AI, Git/Github, Cloud, OpenCV, Django, NodeJs,REST, SQL, Jira, React, Tensorflow, Image processing, Matlab, PostgreSQL, Data Structure and Algorithms, AngularJs. I have soft skills such as Project/ Team Management, Effective Communication. I have done research work for the fraud transaction detection using Federated and Split Learning.  I really think that I can fulfill the responsibilities required for this role. </p>
                <h3>26$</h3>
                <Button variant="primary">Add to cart</Button>
            </div>
        </div>
    )
}

export default ProductDetailScreen;
